import * as C from './QuestionStyling';

export const Question = () => {
    return (
        <C.container>
            <C.question>
                <h1>What is the output of the following program?</h1>
            </C.question>
            <C.block>
                <p>
                    {"const add = (a,b) => {"}
                    {"return a + b;}"}
                </p>
                <p>
                    {"console.log(add(5,3));"}
                </p>
            </C.block>
            <C.optionsContainer>
                <C.option/>
            </C.optionsContainer>
        </C.container>
    );
}
